package com.ding.demo.auth.controller;

import com.ding.demo.auth.dto.LoginRequest;
import com.ding.demo.auth.dto.LoginResponse;
import com.ding.demo.auth.dto.RegisterRequest;
import com.ding.demo.auth.service.AuthService;
import com.ding.demo.common.dto.ApiResponse;
import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.web.bind.annotation.*;

import jakarta.validation.Valid;

@RestController
@RequestMapping("/api/auth")
public class AuthController {

    @Autowired
    private AuthService authService;

    /**
     * 用户登录
     * 
     * @param loginRequest 登录请求参数
     * @return 登录响应结果
     */
    @PostMapping("/login")
    public ApiResponse<LoginResponse> login(@Valid @RequestBody LoginRequest loginRequest) {
        try {
            LoginResponse loginResponse = authService.login(loginRequest);
            return ApiResponse.success(loginResponse);
        } catch (Exception e) {
            return ApiResponse.badRequest(e.getMessage(), null);
        }
    }

    /**
     * 验证token是否有效
     * 
     * @param token JWT token
     * @return 验证结果
     */
    @GetMapping("/validate")
    public ApiResponse<Boolean> validateToken(@RequestParam String token) {
        boolean isValid = authService.validateToken(token);
        return ApiResponse.success(isValid);
    }

    /**
     * 获取token中的用户信息
     * 
     * @param token JWT token
     * @return 用户信息
     */
    @GetMapping("/user-info")
    public ApiResponse<Object> getUserInfo(@RequestParam String token) {
        if (!authService.validateToken(token)) {
            return ApiResponse.unauthorized("无效的token", null);
        }

        Integer userId = Integer.valueOf(authService.getUserIdFromToken(token));
        String userType = authService.getUserTypeFromToken(token);

        return ApiResponse.success(new Object() {
            public final Integer id = userId;
            public final String type = userType;
        });
    }

    /**
     * 用户注册
     * 
     * @param registerRequest 注册请求参数
     * @return 注册结果
     */
    @PostMapping("/register")
    public ApiResponse<String> register(@Valid @RequestBody RegisterRequest registerRequest) {
        try {
            authService.register(registerRequest);
            return ApiResponse.success("注册成功");
        } catch (Exception e) {
            return ApiResponse.badRequest(e.getMessage(), null);
        }
    }
}
